import React from 'react';

const FooterComponent = ({ session }) => {
    // Puedes adaptar el contenido del footer según la sesión si lo necesitas
    return (
        <footer className="footer bg-dark text-white pt-4 pb-2">
            <div className="container text-center">
                <p>&copy; {new Date().getFullYear()} PNK Inmobiliaria. Todos los derechos reservados.</p>
                {/* Puedes añadir más enlaces o información aquí */}
                {session.isLoggedIn && (
                    <p>Sesión activa para: {session.userName}</p>
                )}
            </div>
        </footer>
    );
};

export default FooterComponent;
